						There are 5 sounds that involve both lips:<br><br>
						P/B,F/V and W

					<div id="page_8" style="display: none; font-size: 18px; color: #FFF; padding-top: 20px; padding-left: 20px;">
						There are 3 different ways the air comes out.<Br><Br>
						<a style="color: #FF0000; margin-right: 10px;">P/B</a> The air blocked and released.<br><Br>
						<a style="color: #FF0000; margin-right: 10px">F/V</a> The air buzzes between the top teeth and <br>
						<a style="color: #FF0000; margin-right: 44px"></a>the lower lip.<br><Br>
						<a style="color: #FF0000; margin-right: 21px">W</a>   The air flows out with no resistance at all.
